  render() {

    let className = 'block';
    let color = 'primary';

    document.addEventListener('DOMContentLoaded', function(){
      const gauche = document.querySelector(".gauche");
      const droite = document.querySelector(".droite");

      gauche.addEventListener("mouseenter", () => {
        console.log('ok');
        className += ' a';
        color = 'secondary';
        console.log({className});
      });

      droite.addEventListener("mouseenter", () => {
        console.log('ok droite');
      });



    return (
      <div className={className}>

      <Alert color={color} className="gauche">
        This is a primary alert — check it out!
      </Alert>
      <Alert color="secondary" className="droite">
        This is a primary alert — check it out!
      </Alert>

      </div>
    )
    });
  }
}


export default Test
